async () => {
  return SignUp.run().then(data => {
    showAlert(data.meassage, 'success');
    closeModal(Modal1);
  }).catch(error => {
    if (SignUp.data.message === undefined) {
      showAlert('Too many attempts, SignIn after sometimes', 'warning');
      navigateTo('StartingPage');
    } else showAlert(SignUp.data.message, 'error');
  });
}
